import React, { useState, useEffect } from 'react'
import MaterialTable from 'material-table';

import ViprTablesViewService from '../../../services/ViprTablesViewService';

export default function MaterialTableDemo() {
  const [state, setState] = React.useState({
    columns: [
      { id: 'elnot', title: 'Elnot', width: 50 },
      { id: 'op_mode_id', title: 'Mode', width: 50 },
      { id: 'rf_mode', title: 'RF Min', width: 50 },
      { id: 'rf_mode', title: 'RF Max', width: 50 },
      { id: 'mode_type', title: 'Mode Type', width: 50 },
      { id: 'pri_seq', title: 'Pri Min', width: 50 },
      { id: 'pri_seq', title: 'Pri Max', width: 50 },
      { id: 'pd_mode', title: 'PD Min', width: 50 },
      { id: 'pd_mode', title: 'PD Max', width: 50 },
      { id: 'sp_mode', title: 'SP Min', width: 50 },
      { id: 'sp_mode', title: 'SP Max', width: 50 },
      { id: 'scan_type', title: 'Scan Type', width: 50 },
    ],
    data: [],
  });

  useEffect(() => {
    ViprTablesViewService.getViprTablesView()
    .then(response => {
      setState({data: response.data });
    })
  }, []);

  console.log(state.data);

  return (
    <MaterialTable
      title="Editable Example"
      columns={state.columns}
      data={state.data}
      editable={{
        onRowAdd: newData =>
          new Promise(resolve => {
            setTimeout(() => {
              resolve();
              const data = [...state.data];
              data.push(newData);
              setState({ ...state, data });
            }, 600);
          }),
        onRowUpdate: (newData, oldData) =>
          new Promise(resolve => {
            setTimeout(() => {
              resolve();
              const data = [...state.data];
              data[data.indexOf(oldData)] = newData;
              setState({ ...state, data });
            }, 600);
          }),
        onRowDelete: oldData =>
          new Promise(resolve => {
            setTimeout(() => {
              resolve();
              const data = [...state.data];
              data.splice(data.indexOf(oldData), 1);
              setState({ ...state, data });
            }, 600);
          }),
      }}
    />
  );
}
